CREATE TABLE company (
    id bigint NOT NULL PRIMARY KEY,
    name character varying NOT NULL,
    searchable character varying NOT NULL
);

CREATE TABLE medication (
    id bigint NOT NULL PRIMARY KEY,
    name character varying NOT NULL,
    searchable character varying NOT NULL
);

CREATE TABLE presentation (
    id bigint NOT NULL PRIMARY KEY,
    name character varying NOT NULL,
    searchable character varying NOT NULL
);

CREATE TABLE medication_presentation (
    id bigint NOT NULL PRIMARY KEY,
    dosage_amount character varying(255),
    dosage_unit character varying(255),
    medicationid bigint,
    presentationid bigint,
    FOREIGN KEY (medicationid) REFERENCES medication(id),
    FOREIGN KEY (presentationid) REFERENCES presentation(id)
);

CREATE TABLE company_medication_presentation (
    id bigint NOT NULL PRIMARY KEY,
    companyid bigint NOT NULL,
    medicationpresentationid bigint NOT NULL,
    FOREIGN KEY (companyid) REFERENCES company(id),
    FOREIGN KEY (medicationpresentationid) REFERENCES medication_presentation(id)
);













